import React from 'react';
import { Jumbotron } from 'reactstrap';
import { Image } from 'reactstrap';
import classes from './ProjectJumbotron.css';

const ProjectJumbotron = (props) => (
    <Jumbotron className={classes.jumbotron}>
    <Image src="https://png.pngtree.com/thumb_back/fw800/back_pic/04/43/72/645853706804660.jpg"/>
        <h1>Hello, foodies!</h1>
        <p>
            Are you ready to start your culinary adventures? We are always here for you!
        </p>
    </Jumbotron>
);

export default ProjectJumbotron;
